import React from "react";

function Chat_element(props) {
    return (
        <tr>
            <td>{props.user.id}</td>
            <td>{user.surname}</td>
            <td>{user.name}</td>
            <td>{user.patronymic}</td>
        </tr>
    )
}

export default Chat_element;
